import React from "react";
import FormLogin from "./form";
import "./styles.scss";

const Login = () => {
  return (
    <div className="login">
      <section className="login__section">
        <h1>titulo</h1>
        <div className="login__section--login">
          <FormLogin/>
        </div>
      </section>
      <h2>OLSoftware - 2021</h2>
    </div>
  );
};

export default Login;
